import {AppBar, Typography, Toolbar, Container, makeStyles} from '@material-ui/core'
import { SocialIcon } from 'react-social-icons'

const useStyles = makeStyles(() => ({
    footer: {
        backgroundColor: "#252525",
        height: "100%",
        alignItems: "center",
    },
    aboutus: {
        marginLeft: "500px",
    },
    contactus: {
        marginLeft: "600px",
    },
    // logo: {
    //     fontSize = "0.5vw",
    // }
}))

export default function Footer() {
    const {footer, logo, aboutus, contactus} = useStyles()
    return (
        <AppBar className={footer} position="static" color="primary">
            <Container maxWidth="left">
                <Toolbar>
                <Typography variant="body1" color="inherit">
                    &copy; <h3>2021 Generic CSP Solver</h3> 
                    <div className={aboutus}>
                        <h3>About Us:</h3>
                        <SocialIcon url="http://linkedin.com/in/sanskar-mani-5a8431174/?originalSubdomain=in" />
                        <hr/>
                        {/* <SocialIcon url="http://linkedin.com/in/dhruv-vaishnav-923aa91b6/" />  */}
                    </div>
                    <div className={contactus}>
                        <h3>Contact Us:</h3>
                    </div>    
                </Typography>
                </Toolbar>
            </Container>
        </AppBar>
    )
}
